<!DOCTYPE html>
<html>
<head>
  <title> WINNERS TEAM EVENT RAFFLE DRAW </title>
  <link rel="icon" type="image/x-icon" href="img/favicon.ico">
    <style type="text/css">

      body{
        background: #f3e7d3;
        position: relative;
        margin: 0 !important; 
        padding-top: 70px;       
      }
      

      
      #allNames {
        width: 60%;
        display: none;
     }

     #display{
       display: flex;
        flex-direction: column;
        align-items: center;
     }

    body {
       display: flex;
        flex-direction: column;
        justify-content: space-evenly;
        min-height: 100vh;
       text-align: center
     }

    #errorMessage {
        display: none;
        color: red;
    font-weight: 700;
    font-size: 32px;
    }

    select{
      width: 40%;
      font-size: 28px
    }
    .draw {

        padding: 22px;
        margin-top: 20px;
        width: 169px;
        border-radius: 4px;
        background:#27156D;
        border: none;
        color: white;
        font-weight: bolder;
        font-size: 18px;
        cursor: pointer;
    }
    .draw:hover{
      background: #0091DD;
    }
    button.draw:focus {
        outline: none;
    }
    input[type="text"] {
      width: 55%;
        padding: 17px;
        font-size: 28px;
      }
      .name-row {
        padding: 10px;
        text-align: center;
        font-size: 20px;
        display: flex;
        justify-content: space-between;
    	align-items: center;
    }

    .name-row:nth-child(odd) {
        background: #151ad040;
    }

    .name-row:nth-child(even) {
        background: #0f00ff1a;
    }

      .numberInput{
        display: flex;
        flex-wrap: wrap;
         justify-content: space-around;
         max-width: 920px;
        margin: auto;
        width: 100%;
    }
      
    #loader {
        display: none;
    }

    .name{
      	padding: 0 20px;
        text-align: left;
        text-transform: uppercase;
    }

    .status {
    	padding: 20px;
    	font-weight: 400;
    	text-transform: capitalize;
	}

    @keyframes spin {
        0% { transform: rotate(0deg); }
        100% { transform: rotate(360deg); }
    }
